import React from "react";
import styled from "styled-components";

function Object1() {
  return (
    <div>
      Object 1;
      <ObjectOne />
    </div>
  );
}

export default Object1;

const ObjectOne = styled.div`
  position: absolute;
  width: 321px;
  height: 213px;
  left: 284px;
  top: 108px;
  background-color: #c4c4c4;
`;
